class Solution:
    def candy(self, ratings: List[int]) -> int:
        n=len(ratings)
        sortedArr=[(ratings[i],i) for i in range(n)]
        sortedArr.sort()
        ans=[0]*n
        for i in range(n):
            curCandies=1
            val,index=sortedArr[i]
            if (index>0 and ratings[index-1]<ratings[index] and ans[index-1]>=curCandies):
                curCandies=ans[index-1]+1
            if (index<n-1 and ratings[index+1]<ratings[index] and ans[index+1]>=curCandies):
                curCandies=ans[index+1]+1
            ans[index]=curCandies
        return sum(ans)




