class Solution:
    def wordBreak(self, s: str, wordDict: List[str]) -> List[str]:
        # Time complexity: O(n⋅2^n)
        # Space complexity: O(2^n)

        wordDict = set(wordDict)

        # curr_i is where to continue iteration, stop_i is if > i then eating into next word, don't take
        output = []

        @lru_cache(None)
        def dfs(curr_i, stop_i, word_str):
            if stop_i == 0:
                output.append(word_str[:-1])
            elif curr_i < 0 or curr_i < 0:
                return

            for i in range(curr_i, -1, -1):
                if s[i: stop_i] in wordDict:
                    # Use a set instead of a dictionary, we can do look up of the word instead of looping through the word dic each time
                    dfs(i - 1, i, s[i: stop_i] + " " + word_str)

        dfs(len(s)-1, len(s), "")
        return output


class TestCaseGenerator:

    def generate(self) -> dict:
        test_cases = [{'s': 'catsanddog', 'wordDict': ['cat', 'cats', 'and', 'sand', 'dog']}, {'s': 'pineapplepenapple', 'wordDict': ['apple', 'pen', 'applepen', 'pine', 'pineapple']}, {'s': 'catsandog', 'wordDict': ['cats', 'dog', 'sand', 'and', 'cat']}]
