        return {'s1': s1, 's2': s2}

    def scramble(self, s: str) -> str:
        if len(s) == 1:
            return s
        i = random.randint(1, len(s) - 1)
        x, y = (s[:i], s[i:])
        if random.random() > 0.5:
            return self.scramble(x) + self.scramble(y)
        else:
            return self.scramble(y) + self.scramble(x)

    def encode_input(self, input_obj: dict) -> str:
        return f"{input_obj['s1']},{input_obj['s2']}"

