                    if index >= len(result):
                        result.extend([None] * (index - len(result) + 1))
                    result[index] = node.val
                    queue.append((node.left, 2 * index + 1))
                    queue.append((node.right, 2 * index + 2))
            while result and result[-1] is None:
                result.pop()
            return result
        root = input_obj['root']
        return str(tree_to_list(root))

    def encode_output(self, output_obj: List[int]) -> str:
        return str(output_obj)

    def decode_input(self, input_str: str) -> dict:

        def list_to_tree(nodes: List[Union[int, None]]):
            if not nodes:
                return None
            tree_nodes = [self.TreeNode(val=v) if v is not None else None for v in nodes]
            for i in range(len(nodes)):
                if tree_nodes[i] is not None:
                    left_index = 2 * i + 1
                    right_index = 2 * i + 2
                    if left_index < len(tree_nodes):
                        tree_nodes[i].left = tree_nodes[left_index]
                    if right_index < len(tree_nodes):
                        tree_nodes[i].right = tree_nodes[right_index]
            return tree_nodes[0] if tree_nodes else None
        nodes_list = eval(input_str)
        root = list_to_tree(nodes_list)
        return {'root': root}

