class Solution:
    def longestValidParentheses(self, s: str) -> int:
        memo = {}
        def dfs(i):
            if i >= len(s):
                return 0
            if i in memo:
                return memo[i]
            memo[i] = 0
            if s[i] == '(':
                if i + 1 < len(s) and s[i + 1] == ')':
                    memo[i] = dfs(i + 2) + 2
                elif i + dfs(i + 1) + 1 < len(s) and s[i + dfs(i + 1) + 1] == ')':
                    memo[i] = dfs(i + 1) + 2 + dfs(i + dfs(i + 1) + 2)
            return memo[i]

        for i in range(len(s)):
            dfs(i)
        return max(memo.values()) if memo else 0

