class Solution:
    def longestPalindrome(self, s: str) -> str:
        longest = s[0]
        palin = set()
        for i in range(len(s)):
            for j in range(i + 1, len(s)):
                if j - i < len(longest):
                    continue
                _s = s[i : j + 1]
                if _s in palin:
                    continue
                elif self.check(_s, palin):
                    palin.add(_s)
                    if len(_s) > len(longest):
                        longest = _s
        return longest

    def check(self, s, palin):
        n = len(s)
        i = 0
        j = n - 1
        while i < j:
            if s in palin:
                return True
            if s[i] != s[j]:
                return False
            else:
                i += 1
                j -= 1
        return True


