class Solution:
    def maxCoins(self, nums: List[int]) -> int:
        nums = [1]+nums+[1]

        memo = {}
        def dfs(leftbound,rightbound):
            if (leftbound,rightbound) in memo:
                return memo[(leftbound,rightbound)]

            if rightbound-leftbound<=1:
                return 0

            res = 0

            for i in range(leftbound+1,rightbound):
                gain = nums[leftbound]*nums[i]*nums[rightbound]
                total_gain = dfs(leftbound,i)+gain+dfs(i,rightbound)
                res = max(total_gain,res)

            memo[(leftbound,rightbound)] =res
            return res

        return dfs(0,len(nums)-1)







