class Solution:
    def removeInvalidParentheses(self, s: str) -> List[str]:
        def dfs(i, c, o):
            if o < 0:
                return set()
            if i == len(s):
                if o == 0:
                    return {c}
                else:
                    return set()

            combos = set()
            if s[i] == "(":
                combos |= dfs(i + 1, c + "(", o + 1)
                combos |= dfs(i + 1, c, o)
            elif s[i] == ")":
                combos |= dfs(i + 1, c + ")", o - 1)
                combos |= dfs(i + 1, c, o)
            else:
                combos |= dfs(i + 1, c + s[i], o)

            maxlen = 0
            for c in combos:
                maxlen = max(maxlen, len(c))
            for c in list(combos):
                if len(c) < maxlen:
                    combos.remove(c)

            return combos

        return list(dfs(0, "", 0))


