class Solution:
    def maximumGap(self, nums: List[int]) -> int:
        if len(nums) < 2:
            return 0
        if len(nums) == 2:
            return abs(nums[0] - nums[1])
        nmax, nmin = max(nums), min(nums)
        if nmax == nmin:
            return 0
        num_buckets = len(nums) - 1
        bucket_size = (nmax - nmin) / num_buckets
        buckets = [[float('inf'), -1] for _ in range(num_buckets)]
        for num in nums:
            bucket_num = min(int((num - nmin) // bucket_size), num_buckets - 1)
            buckets[bucket_num][0] = min(buckets[bucket_num][0], num)
            buckets[bucket_num][1] = max(buckets[bucket_num][1], num)
        prev_bucket = buckets[0]
        ret = -1
        for i in range(1, len(buckets)):
            cur_bucket = buckets[i]
            if cur_bucket[1] != -1:
                ret = max(ret, cur_bucket[0] - prev_bucket[1])
                prev_bucket = cur_bucket
        return ret

