class Solution:
    def maximalSquare(self, matrix: List[List[str]]) -> int:
        R, C = len(matrix), len(matrix[0])

        sums = [[0 for c in range(C + 1)] for r in range(R + 1)]

        for r in range(1, R + 1):
            for c in range(1, C + 1):
                sums[r][c] = sums[r][c - 1] + sums[r - 1][c] - sums[r - 1][c - 1] + int(matrix[r - 1][c - 1])

        result = 0

        for r in range(1, R + 1):
            for c in range(1, C + 1):
                if matrix[r - 1][c - 1] == "0":
                    continue

                st, en = 1, min(R - r + 1, C - c + 1)
                while en - st > 1:
                    md = (st + en) // 2
                    if sums[r + md - 1][c + md - 1] - sums[r + md - 1][c - 1] - sums[r - 1][c + md - 1] + sums[r - 1][c - 1] == md * md:
                        st = md
                    else:
                        en = md
                if sums[r + en - 1][c + en - 1] - sums[r + en - 1][c - 1] - sums[r - 1][c + en - 1] + sums[r - 1][c - 1] == en * en:
                    st = en

                result = max(result, st)

        return result * result


