class Solution:
    def nthUglyNumber(self, n: int) -> int:

        heap = [1]
        count=1
        while count<n:
            smal = heappop(heap)
            if smal*2 not in heap:
                heappush(heap,smal*2)
            if smal*3 not in heap:
                heappush(heap,smal*3)
            if smal*5 not in heap:
                heappush(heap,smal*5)
            count+=1
        return heap[0]








