class Solution:
    def uniquePaths(self, m: int, n: int) -> int:
        numberOfWays = [[0] * n for _ in range(m)]
        numberOfWays[0][0] = 1

        for i in range(m):
            for j in range(n):
                if i == 0 and j == 0:
                    numberOfWays[i][j] = 1
                elif i == 0:
                    numberOfWays[i][j] = numberOfWays[i][j-1]
                elif j == 0:
                    numberOfWays[i][j] = numberOfWays[i-1][j]
                else:
                    numberOfWays[i][j] = numberOfWays[i-1][j] + numberOfWays[i][j-1]

        return numberOfWays[-1][-1]



