class Solution:
    def climbStairs(self, n: int) -> int:
        return self._dfs(n, {})

    def _dfs(self, n: int, memo: dict[int, int]):
        if n == 0 or n == 1:
            return 1
        if n not in memo:
            memo[n] = self._dfs(n - 1, memo) + self._dfs(n - 2, memo)
        return memo[n]

