class Solution:
    def totalNQueens(self, n: int) -> int:
        board = [[0] * n for _ in range(n)]
        count = 0

        def helper(row):
            nonlocal count

            if row == n:
                count+=1
                return

            for c in range(len(board[row])):
                can = True

                for r in range(row):
                    for j in range(len(board[r])):
                        if board[r][j] == 0:
                            continue
                        if j == c:
                            can = False
                            break
                        if abs(j-c) == (row - r):
                            can = False
                            break

                if can:
                    board[row][c] = 1
                    helper(row+1)
                    board[row][c] = 0

        helper(0)
        return count





