class Solution:
    def canJump(self, nums: List[int]) -> bool:
        dp = [0]*len(nums)
        dp[0] = 1
        for i in range(len(nums)):
            if dp[i]==0:
                return False

            for j in range(nums[i]):
                if i+j+1 < len(dp):
                    dp[i+j+1] = 1

                if dp[-1]==1:
                    return True

        return True

