class Solution:
    def lengthOfLastWord(self, s: str) -> int:
        r=len(s)
        k=r
        count=0
        while(k>0 and s[k-1]==" "):
            k-=1
        if k==0:
            return 0
        for i in range(k-1,-1,-1):
            if s[i]!=" ":
                count+=1
            else:
                break
        return count







