class Solution:
    def getPermutation(self, n: int, k: int) -> str:
        def nextPermutation(lst):
            if len(lst)==1:
                return lst
            else:
                e=len(lst)-1
                b=[]
                while (lst[e]<=lst[e-1]):
                    b.append(lst[e])
                    e=e-1
                    if e==0:
                        return []
                b.append(lst[e])
                b.append(lst[e-1])
                pivot=lst[e-1]
                min_next=max(lst)+1
                for element in b:
                    if element > pivot and element<min_next:
                        min_next=element
                m=lst[0:e-1]
                m.append(min_next)
                b.remove(min_next)
                b.sort()
                for e in b:
                    m.append(e)
                return m
        if n==1:
            return str(n)
        else:
            nums=[]
            for i in range(1,n+1):
                nums.append(i)
            count=1
            while(count<k):
                nums=nextPermutation(nums)
                count+=1
            s=''
            for elem in nums:
                s+=str(elem) 
        return s


