class Solution:
    def count_perimeter_at(self, neiboughr_matrix, grid, i, j):
        counter = 0
        for step in neiboughr_matrix:
            new_step = [step[0] + i, step[1] + j]
            if not (0 <= new_step[0] < len(grid)):
                counter += 1
                continue
            elif not (0 <= new_step[1] < len(grid[0])):
                counter += 1
                continue
            elif grid[new_step[0]][new_step[1]] == 0:
                counter += 1
        return counter

    def islandPerimeter(self, grid: List[List[int]]) -> int:
        neiboughr_matrix = [[1, 0], [0, 1], [-1, 0], [0, -1]]
        counter = 0
        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if grid[i][j] == 1:
                    counter += self.count_perimeter_at(neiboughr_matrix, grid, i, j)
        return counter


