from collections import defaultdict

class Solution:
    def findRedundantDirectedConnection(self, edges: List[List[int]]) -> List[int]:
        graph = defaultdict(lambda: set())
        num_incoming_edges = defaultdict(lambda: 0)

        for edge in edges:
            a, b = edge[0], edge[1]
            graph[a].add(b)
            num_incoming_edges[b] += 1

        def findCyclesDfs(root, curr, history, visited):
            if curr == root:
                return history
            if curr in visited:
                return
            visited.add(curr)
            for node in graph[curr]:
                history.add((curr, node))
                result = findCyclesDfs(root, node, history, visited)
                if result is not None:
                    return result
                history.remove((curr, node))

        redundant_edge = None
        known_cycle_edges = None

        for edge in edges:
            a, b = edge[0], edge[1]
            known_cycle_edges = findCyclesDfs(a, b, {(a, b)}, set()) if known_cycle_edges is None else known_cycle_edges

            if num_incoming_edges[b] > 1:
                redundant_edge = edge
            if known_cycle_edges and (a, b) in known_cycle_edges:
                if edge == redundant_edge:
                    return edge
                else:
                    redundant_edge = edge

        return redundant_edge


