    def movesToStamp(self, stamp: str, target: str) -> List[int]:
        def can_stamp(i):
            changed = False
            for j in range(len(stamp)):
                if target[i + j] == '?':
                    continue
                if target[i + j] != stamp[j]:
                    return False
                changed = True
            return changed

        def do_stamp(i):
