class Solution:
    def diStringMatch(self, s: str) -> List[int]:
        # x is less than y
        greaterthan = {}
        lessthan = {}
        for i, c in enumerate(s):
            a, b = i, i+1
            if c == "D":
                a, b = b, a

            # a < b
            if a not in greaterthan:
                greaterthan[a] = set()
            if b not in lessthan:
                lessthan[b] = set()
            greaterthan[a].add(b)
            lessthan[b].add(a)



        n = len(s)
        zero_candidates = [x for x in range(n+1) if x not in lessthan]

        q = list(zero_candidates)
        assignments = [-1] * (n+1)
        counter = 0
        while q:
            curr = q.pop()
            assignments[curr] = counter
            counter += 1
            if curr not in greaterthan:
                continue
            for bigger in greaterthan[curr]:
                lessthan[bigger].remove(curr)
                if len(lessthan[bigger]) == 0:
                    q.append(bigger)
        return assignments

