class BIT:

    def __init__(self, n):
        self.n = n+1
        self.lt = [0]*self.n

    def search(self, indx):
        res = 0
        while indx<self.n:
            res += self.lt[indx]
            indx += indx&(-indx)
        return res

    def update(self, indx):
        while indx>0:
            self.lt[indx] += 1
            indx -= indx&(-indx)


class Solution:
    # https://leetcode.com/problems/reverse-pairs/solutions/97268/general-principles-behind-problems-similar-to-reverse-pairs/
    def reversePairs(self, nums: List[int]) -> int:
        res = 0
        bit = BIT(len(nums)+1)

        def binary_search(lt, target):
            l, r = 0, len(lt)
            while l<r:
                m = l + ((r-l)>>1)
                if target<=lt[m]:
                    r = m
                else:
                    l = m+1
            return l

        new = sorted(nums)
        for x in nums:
            indx = binary_search(new, 2*x+1)+1
            res += bit.search(indx)
            indx = binary_search(new, x)+1
            bit.update(indx)
        return res

