class Solution:
    def cherryPickup(self, grid: List[List[int]]) -> int:
        n = len(grid)
        dp = [[[-float('inf')] * n for _ in range(n)] for _ in range(2 * n - 1)]
        dp[0][0][0] = grid[0][0]  # Base case

        for k in range(1, 2 * n - 1):
            for x1 in range(max(0, k - (n - 1)), min(n, k + 1)):
                for x2 in range(max(0, k - (n - 1)), min(n, k + 1)):
                    y1, y2 = k - x1, k - x2
                    if grid[x1][y1] == -1 or grid[x2][y2] == -1:
                        continue

                    best = -float('inf')
                    for d1 in [0, 1]:
                        for d2 in [0, 1]:
                            px1, px2 = x1 - d1, x2 - d2
                            if px1 >= 0 and px2 >= 0:
                                best = max(best, dp[k-1][px1][px2])

                    if best == -float('inf'):
                        continue

                    dp[k][x1][x2] = best + grid[x1][y1]
                    if x1 != x2:
                        dp[k][x1][x2] += grid[x2][y2]

        return max(0, dp[2*n-2][n-1][n-1])

