class Solution:
    def largestIsland(self, grid: List[List[int]]) -> int:

        directions = {(-1, 0), (1, 0), (0, -1), (0, 1)}
        uniqueKey = 0
        positionToArea = {}
        def findAndSetArea(row, col):
            queue = [(row, col)]
            visited = set()
            visited.add((row, col))

            area = 0
            while queue:
                row, col = queue.pop(0)
                area += 1

                for direction in directions:
                    nextRow, nextCol = row + direction[0], col + direction[1]
                    if ( 0 <= nextRow < len(grid) and 
                         0 <= nextCol < len(grid[0]) and 
                         grid[nextRow][nextCol] and 
                         (nextRow, nextCol) not in visited
                    ): 
                        queue.append((nextRow, nextCol))
                        grid[nextRow][nextCol] = -1
                        visited.add((nextRow, nextCol))

            for r, c in visited:
                positionToArea[(r, c)] = [uniqueKey, area]
            return area

        maxArea = 0
        zeroPositions = set()
        for row in range(len(grid)):
            for col in range(len(grid[0])):
                if grid[row][col] == 1: 
                    area = findAndSetArea(row, col)
                    uniqueKey += 1
                    maxArea = max(maxArea, area)
                elif grid[row][col] == 0: zeroPositions.add((row, col))

        for row, col in zeroPositions:
            areaWithThis0 = 1
            keys = set()
            for direction in directions:
                nextRow, nextCol = row + direction[0], col + direction[1]
                key, area = positionToArea.get((nextRow, nextCol), [-1, 0])
                if key not in keys:
                    keys.add(key)
                    areaWithThis0 += area
            maxArea = max(maxArea, areaWithThis0)

        return maxArea

